  background: red;
  text-align: center;
  width: calc(100% / 4);
  padding: 20px;
  display: inline-block;
  box-sizing: border-box;

  @media (min-width: 100px) {
    color: #000;
    background: blue;
    width: calc(100% / 2);
  }
`

class Box extends Component {
  render() {
    return (
      <Wrapper>
        <Icon
          percent={this.props.percent}
          code={this.props.code}
          type={this.props.type}
        />
